import React, { useState, useEffect } from 'react';
import { Box } from '../../styles/main/MainStyles';

export default function DropoffTile({ color, remove, index, setRemove, onMouseLeave, onClick }) {
  const [hover, setHover] = useState(true);
  const [hide, setHide] = useState(remove)

  useEffect(() => {
    setHide(remove)
  }, [remove])

  return (
    <svg
      onMouseEnter={() => {
        setHover(true)
        try {
          setRemove(index) 
        } catch(err) {

        }
      }}
      onMouseLeave={hide ? () => {
          setHover(false)
          try {
            setRemove(null)
          } catch(err) {
            
          }
        } : onMouseLeave}
      onClick={onClick}
      style={{ marginLeft: 5 , opacity: hide && 0.8 }}
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      width="50"
      height="50"
      fill="none"
      viewBox="0 0 50 50"
    >
      <rect width="50" height="50" fill={color || "#999999"} rx="10"></rect>
      <path fill="url(#pattern2)" d="M2 2H48V48H2z"></path>
      <defs>
        <pattern
          id="pattern2"
          width="1"
          height="1"
          patternContentUnits="objectBoundingBox"
        >
          <use
            transform="matrix(.0028 0 0 .0028 -.308 -.04)"
            xlinkHref="#image2"
          ></use>
        </pattern>
        <image
          id="image2"
          width="577"
          height="433"
          xlinkHref="data:image/png;base64,"
        ></image>
      </defs>
    </svg>
  );
}